import React, { useState, useEffect } from 'react';
import { VuiFlexContainer, VuiFlexItem, VuiTitle, VuiText, VuiSpacer } from '../../ui';
import { AppHeader } from '../chrome/AppHeader';
import './harvardManagementDocuments.scss';
import { useSearchContext } from '../../contexts/SearchContext';

// Define document type
interface Document {
  id: string;
  title: string;
  date: string;
  type: string;
  company: string;
  description?: string;
  url?: string;
}

// Sample documents
const DOCUMENTS: Document[] = [
  {
    id: "doc-001",
    title: "10-k Apple.pdf",
    date: "2024",
    type: "10-K",
    company: "Apple"
  },
  {
    id: "doc-002",
    title: "10-k Goldman Sachs.pdf",
    date: "2024",
    type: "10-K",
    company: "Goldman Sachs"
  },
  {
    id: "doc-003",
    title: "Tiger Global.pdf",
    date: "2024",
    type: "Investment Report",
    company: "Tiger Global"
  },
  {
    id: "doc-004",
    title: "Bridgewater Associates.pdf",
    date: "2024",
    type: "Investment Report",
    company: "Bridgewater Associates"
  },
  {
    id: "doc-005",
    title: "investment-monthly-jan25.pdf",
    date: "January 2025",
    type: "Market Outlook",
    company: "Harvard Management Company"
  },
  {
    id: "doc-006",
    title: "weekly-investment-commentary-en-us-20250310-big-policy-shifts-reinforce-higher-rates.pdf",
    date: "March 10, 2025",
    type: "Market Commentary",
    company: "Harvard Management Company"
  },
  {
    id: "doc-007",
    title: "article_thebeatoutlook2025.pdf",
    date: "2025",
    type: "Market Outlook",
    company: "Harvard Management Company"
  },
  {
    id: "doc-008",
    title: "210630 IFM Australian Private Equity Fund IV - Quarterly Report.pdf",
    date: "June 30, 2021",
    type: "Quarterly Report",
    company: "IFM Australian Private Equity Fund IV"
  },
  {
    id: "doc-009",
    title: "2309 ICPF Quarterly Report.pdf",
    date: "September 2023",
    type: "Quarterly Report",
    company: "ICPF"
  },
  {
    id: "doc-010",
    title: "210331 SPE3 Quarterly Report.pdf",
    date: "March 31, 2021",
    type: "Quarterly Report",
    company: "SPE3"
  },
  {
    id: "doc-011",
    title: "2306 Morgan Stanley - Quarterly Report.pdf",
    date: "June 2023",
    type: "Quarterly Report",
    company: "Morgan Stanley"
  },
  {
    id: "doc-012",
    title: "Capstone 13-F Information Table.pdf",
    date: "2024",
    type: "13-F",
    company: "Capstone"
  },
  {
    id: "doc-013",
    title: "Copia 13-F Information Table.pdf",
    date: "2024",
    type: "13-F",
    company: "Copia"
  },
  {
    id: "doc-014",
    title: "Arcadia13-F Information Table.pdf",
    date: "2024",
    type: "13-F",
    company: "Arcadia"
  },
  {
    id: "doc-015",
    title: "lipper_materials_1.pdf",
    date: "2024",
    type: "Materials",
    company: "Lipper"
  }
];

export const HarvardManagementDocuments = () => {
  const { onSearch } = useSearchContext();
  const [documents, setDocuments] = useState<Document[]>(DOCUMENTS);
  const [sortOrder, setSortOrder] = useState<'asc' | 'desc'>('desc');
  const [searchTerm, setSearchTerm] = useState('');

  // Handle document search
  useEffect(() => {
    if (searchTerm === '') {
      setDocuments(DOCUMENTS);
    } else {
      const filtered = DOCUMENTS.filter(doc => 
        doc.title.toLowerCase().includes(searchTerm.toLowerCase()) ||
        doc.type.toLowerCase().includes(searchTerm.toLowerCase()) ||
        doc.company.toLowerCase().includes(searchTerm.toLowerCase())
      );
      setDocuments(filtered);
    }
  }, [searchTerm]);

  // Handle sort order change
  const handleSortChange = () => {
    const newOrder = sortOrder === 'desc' ? 'asc' : 'desc';
    setSortOrder(newOrder);

    const sorted = [...documents].sort((a, b) => {
      const dateA = new Date(a.date);
      const dateB = new Date(b.date);
      return newOrder === 'desc' ? 
        dateB.getTime() - dateA.getTime() : 
        dateA.getTime() - dateB.getTime();
    });

    setDocuments(sorted);
  };

  // Handle document click
  const handleDocumentClick = (document: Document) => {
    if (document.title) {
      onSearch({ value: document.title });
    }
  };

  return (
    <div className="documentsPage">
      <AppHeader />

      <div className="documentsContainer">
        <VuiFlexContainer direction="column" spacing="l">
          <VuiFlexItem>
            <VuiFlexContainer justifyContent="spaceBetween" alignItems="center">
              <VuiFlexItem>
                <VuiTitle size="m">
                  <h2>Documents</h2>
                </VuiTitle>
              </VuiFlexItem>
              <VuiFlexItem grow={false}>
                <div className="documentControls">
                  <input 
                    type="text" 
                    placeholder="Search documents..."
                    value={searchTerm}
                    onChange={(e) => setSearchTerm(e.target.value)}
                    className="documentSearchInput"
                  />
                  <button 
                    className="modernButton sortButton" 
                    onClick={handleSortChange}
                  >
                    Sort by Date {sortOrder === 'desc' ? '(Newest First)' : '(Oldest First)'}
                  </button>
                </div>
              </VuiFlexItem>
            </VuiFlexContainer>
          </VuiFlexItem>

          <VuiSpacer size="m" />

          {documents.length > 0 ? (
            <VuiFlexContainer direction="column" spacing="s">
              {documents.map(doc => (
                <VuiFlexItem key={doc.id}>
                  <div className="documentItem" onClick={() => handleDocumentClick(doc)}>
                    <div className="documentInfo">
                      <div className="documentTitle">{doc.title}</div>
                      <div className="documentMeta">
                        <span className="documentCompany">{doc.company}</span>
                        <span className="documentType">{doc.type}</span>
                      </div>
                    </div>
                    <div className="documentDate">{doc.date}</div>
                  </div>
                </VuiFlexItem>
              ))}
            </VuiFlexContainer>
          ) : (
            <VuiFlexItem>
              <VuiText>
                <p className="noDocuments">No documents matching your search criteria.</p>
              </VuiText>
            </VuiFlexItem>
          )}
        </VuiFlexContainer>
      </div>
    </div>
  );
};
